import React, { useEffect, useState } from 'react';
import { apiUrl, axiosInstance, generateRefreshToken } from '../axios';

export default function AllUsers() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getUser();
  }, []);

  // LIST
  const getUser = async () => {
    await axiosInstance
      .get(apiUrl + '/medical_store_app/user')
      .then((response) => {
        if (response.status === 200) {
          // Filter users where auth_user is false
          const filteredUsers = response.data.filter(user => user.auth_user === false);
          setUsers(filteredUsers);
        }
      })
      .catch((error) => {
        if (error.response?.status === 401) {
          generateRefreshToken(error);
        }
      });
  };

  return (
    <div>
      <div className="row m-3">
        <h1>All Users</h1>
      </div>
      <div className="container m-5">
        <div className="mt-3">
          <table className="table table-striped">
            <thead className="thead-dark">
              <tr>
                <th>SL No</th>
                <th>Name</th>
                <th>lastName</th>
                <th>Username</th>
                <th>Email</th>
                <th>Registered On</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user, i) => (
                <tr key={`user_rows${i}`}>
                  <td>{i + 1}</td>
                  <td>{user.first_name + ' ' + user.last_name}</td>
                  <td>{user.username}</td>
                  <td>{user.email}</td>
                  <td>{user.is_superuser ? 'Super Admin' : 'Regular User'}</td>
                  <td>{user.date_joined?.split('T')[0]}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
